import React from "react";
import Typography from "@material-ui/core/Typography";
import { jsxDecorator } from "storybook-addon-jsx";
import { Paper, Divider, Grid } from "@material-ui/core";
import { makeStyles, MuiThemeProvider } from "@material-ui/core/styles";
import { storiesOf } from "@storybook/react";
import themes from "../../Theme/themes";
import { muiTheme } from "storybook-addon-material-ui";

import Theme from "../../Theme";
import AirportTag from "../AirportTag";

const useStyles = makeStyles((theme) => ({
    root: {
        boxShadow: theme.shadows[24],
        margin: "20px",
        padding: "20px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        margin: "20px",
        padding: "20px",
    },
}));

export const DefaultAirportTag = ({label, brand, mode}) => {
    const classes = useStyles();

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="airtag">
                <Typography variant="h3">Airport Tag</Typography>
                <br />
                <Divider />
                <br />

                <Grid container spacing={2}>
                    <Grid item xs={12} lg={6}>
                        <AirportTag label={label}/>
                    </Grid>
                </Grid>
            </Paper>
        </MuiThemeProvider>
    );
};

storiesOf("Components/AirportTag", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .addDecorator(muiTheme([Theme]))
    .addDecorator(jsxDecorator)
    .add("Default ", (args) => <DefaultAirportTag {...args} />,
        {
            args: {
                label: 'Airport Text',
                brand: "CVC",
                mode: "root"
            },
            argTypes: {
                label: { type: 'string' },
                brand: {
                    type: "select",
                    options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
                },
                mode: {
                    type: "select",
                    options: ["root", "darkBg"]
                }
            }
        });
